window.bookSummaryJSON = "<p>King Randor has been defeated. Queen Alassa has taken her throne. The Kingdom of Zangaria can look forward to a new age of peace and prosperity. But their victory came at a terrible price. A moment before his death, King Randor hit Emily with a powerful curse.</p> <p>She's lost her magic. She's losing her mind. She may soon lose her life.</p> <p>As rumors start to spread, as her enemies start to gather, Emily searches desperately for the key to unlock the curse before it is too late. But the only hope seems to rest with House Fellini, an enigmatic family of magicians. Crippled, powerless, helpless, Emily places her life in their hands. If they can't help her, no one can.</p> <p>But House Fellini has its secrets. As the family struggles to undo the curse before it's too late, Emily is drawn into a decades-old mystery that threatens to destroy the family, shatter her life...and smash the entire world beyond all hope of repair.</p>"; 
